import React, {Component} from "react";

import "../overviewPage/overviewPage.css";

// Komponenty
import AccountInfo from "./AccountInfo";
import CreditCardInfo from "./CreditCardInfo";import { Link } from "react-router-dom";
;

export default class OverviewIndex extends Component {

// Změna titulku ///////////////////////////////////////////////////////////////////

    componentDidMount() {
        document.title = "Přehled | Web Bank";
    }

// Vykreslení //////////////////////////////////////////////////////////////////////

    render() {

        return (
            <div id="content">

                <div id="firstColumn">
                    <AccountInfo userID={this.props.userID} />
                    <CreditCardInfo userID={this.props.userID} />
                    <Link id="newPayment" >Nová platba</Link>
                </div>
            </div>
        )
    }

}
